import fetch from 'isomorphic-unfetch';

const Index = props => (
    <div className="container">
        <h1>Hello Next.js</h1>
        <p>win test next.js app</p>

        <div className="row">
        {props.shows.map(show => (
        <div className="col-3" key={show.id}>
            <div className="card text-white bg-primary mb-4">
                <div className="card-header">{show.name}
                    <h4 className="card-title">{show.type}</h4>
                    <img src={show.image.medium} />
                </div>
            </div>
        </div>
        ))}
        </div>

    </div>
);

Index.getInitialProps = async function () {
  const res = await fetch('https://api.tvmaze.com/search/shows');
  const data = await res.json();

  console.log(`Show data fetched. Count: ${data.length}`);

  return {
    shows: data.map(entry => entry.show)
  };
}



export default Index;
